    <div className='row g-0'>
    <div className='col-md-4'>
    <img
        src={card.avatar_url}
        alt={name}
        className="card-img-top"
        style={{ backgroundColor: "grey" }}
      />
    </div>
    </div>
    </div>
  );
};


export default BotSpecs;
